import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { map, Observable } from 'rxjs';
import { Dog, DogsService } from './dogs.service';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-dog-view',
  standalone: true,
  imports: [CommonModule],
  template: `
    <article class="details-panel" *ngIf="dog$ | async as dog">
      <img
        class="main-img"
        src="{{ dog.photoUrl }}"
        alt="Photo of {{ dog.name }}"
      />
      <article>
        <h1 class="main-text">Hi, I'm {{ dog.name }}</h1>
        <h2>
          My owner's name is <span class="emphasize">{{ dog.ownerName }}</span>
        </h2>
        <p>{{ dog.longDescription }}</p>
        <p>
          I live in <span class="emphasize">{{ dog.location }}</span>
        </p>
      </article>
    </article>
  `,
  styles: [
    `
      .details-panel {
        display: flex;
        padding: 10px;
        gap: 50px;
      }
      .main-img {
        border-radius: 10px;
        width: 400px;
      }
      .main-text {
        font-size: 34pt;
        margin-bottom: 20px;
      }
      .emphasize {
        font-weight: bold;
      }
      h2 {
      }
    `,
  ],
})
export class DogViewComponent {
  dog$?: Observable<Dog | undefined>;
  constructor(
    private dogsService: DogsService,
    private route: ActivatedRoute
  ) {}

  ngOnInit(): void {
    this.dog$ = this.route.paramMap.pipe(
      map((param) => {
        return this.dogsService.dogs[Number(param.get('index'))];
      })
    );
  }
}

